import React from 'react'
import project from '../../components/section/projects/timeline/project'

const AllProjects = () => {
    return (<div>
        {project.map((element, index) => (
            <div key={index}>{element.title} {element.location} {element.description}!</div>
        ))}
        </div>);
}

export default AllProjects
